layers.vertexShader:
#version 300 es
in vec2 aPos;
in vec3 aColor;
out vec3 vColor;
void main(){
    gl_Position = vec4(aPos, 0.0, 1.0);
    vColor = aColor;
}

layers.fragmentShader:
#version 300 es
precision mediump float;
uniform vec4 uColor;
in vec3 vColor;
out vec4 outColor;
void main(){
    outColor = vec4(vColor, uColor.a);
}

layers.vertexShader:
#version 300 es
precision mediump float;
in vec2 aPos;
uniform float uPhase;
in vec3 aColor;
out vec3 vColor;

void main(){
    vec2 pos = aPos;
    pos.y += sin(pos.x + uPhase) * 0.0001;
    pos.x += cos(pos.y + uPhase) * 0.03;
    gl_Position = vec4(pos, 0.0, 1.0);
    vColor = aColor;
}

