layers.vertexShader:
#version 300 es
precision mediump float;
in vec2 aPos;
uniform float uNormalizedTime;
in vec3 aColor;
out vec3 vColor;

void main(){
    vec2 pos = aPos;
    float t = uNormalizedTime;
    float sniff = 0.0;

    // Two quick sniffs with different intensities
    // First sniff: 8-12% of period (stronger)
    if (t >= 0.08 && t <= 0.12) {
        float phase = (t - 0.08) / 0.04;
        sniff = sin(phase * 3.14159) * 0.2 * pow(sin(phase * 3.14159), 3.0);
    }
    // Second sniff: 12-16% of period (slightly weaker)
    else if (t >= 0.12 && t <= 0.16) {
        float phase = (t - 0.12) / 0.04;
        sniff = sin(phase * 3.14159) * 0.15 * pow(sin(phase * 3.14159), 3.0);
    }
    // Third sniff: 58-62% (stronger)
    else if (t >= 0.58 && t <= 0.62) {
        float phase = (t - 0.58) / 0.04;
        sniff = sin(phase * 3.14159) * 0.2 * pow(sin(phase * 3.14159), 3.0);
    }
    // Fourth sniff: 62-66% (slightly weaker)
    else if (t >= 0.62 && t <= 0.66) {
        float phase = (t - 0.62) / 0.04;
        sniff = sin(phase * 3.14159) * 0.15 * pow(sin(phase * 3.14159), 3.0);
    }

    // Apply sniff motion with falloff based on Y position
    float noseFactor = 1.0;
    if (pos.y > 0.2) {
        noseFactor = 1.0;
    } else if (pos.y > -0.2) {
        noseFactor = (pos.y + 0.2) / 0.4 * 0.7 + 0.3;
    } else {
        noseFactor = 0.1;
    }

    pos.y += sniff * noseFactor;
    if (sniff > 0.0) {
        pos.x *= 1.0 - sniff * 0.1 * noseFactor;
    }

    gl_Position = vec4(pos, 0.0, 1.0);
    vColor = aColor;
}

